// Authentication Page
// @author: @rishisant
// @date: 2022-12-11

import {useNavigate} from 'react-router-dom';
import React from 'react';
import './AuthenticateStyle.css';
// import {raise_admin_bar} from './HomeFunctions';
// import {raise_admin_bar} from './HomeFunctions';
import {raise_admin_bar} from './HomeFunctions';

const AuthenticateS = () => {
    const navigate = useNavigate();

    return (
        <div id="homecontainer">
            <img id="mainlogo" src={require('./components/img/hss_transparent.png')} alt="Logo"></img>
            <input type="text" class="authfield" id="username_field" name="fname"></input>
            <input type="text" class="authfield" id="password_field" name="fname"></input>

            <div id="adminpanel" style="visibility:hidden;"></div>
        </div>

    )

};
export default AuthenticateS;
